  false,\n\t\"url\": null,\n\t\"notes\": \"Ecological indicators can facilitate Ecosystem-based
  Management, but only if targets for indicators exist. Because targets are an expression
  of the desired state of the ecosystem, establishing targets must include ecological
  understanding and societal values. This project will develop a unique approach for
  identifying scientifically rigorous ecosystem targets that explicitly consider social
  perspectives. Focusing on the PSP species and food web goal, we will:nn1) Identify
  a set of critical ecosystem attributes, and use a food web model to examine changes
  to these attributes as a result of simulated changes of nearshore habitat and water
  quality; andnn2) Conduct social norm analyses in which stakeholders are asked to
  rate the desirability of a range of potential ecosystem conditions. By completing
  each of these tasks, we will uniquely blend ecological and social science to inform
  the creation of scientifically rigorous and socially responsive management targets.nnSociology
  data.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
